INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 1, 24001, 1, "あたしだって\nやるときはやるよ！", 24, 10040, "2020/04/30 12:00:00", 0, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 1, 24002, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 24, 10040, "2020/04/30 12:00:00", 1, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 1, 24003, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 24, 10040, "2020/04/30 12:00:00", 2, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 2, 24004, 2, "やったね！\nこれでようやく\nサボれるよ…", 24, 10040, "2020/04/30 12:00:00", 3, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 1, 24005, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 24, 10040, "2020/04/30 12:00:00", 4, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 2, 24006, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 24, 10040, "2020/04/30 12:00:00", 5, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 2, 24007, 2, "あたしも意外と\nやるもんでしょ？", 24, 10040, "2020/04/30 12:00:00", 6, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 4, 24008, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 24, 10040, "2020/04/30 12:00:00", 7, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 4, 24009, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 24, 10040, "2020/04/30 12:00:00", 8, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 4, 24010, 4, "まじめに\nやったんだけどな…\n悔しいな～", 24, 10040, "2020/04/30 12:00:00", 9, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 4, 24011, 4, "やられた…\nねずみって意外と\nてごわいね", 24, 10040, "2020/04/30 12:00:00", 10, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 0.0, 0.0, 4, 24012, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 24, 10040, "2020/04/30 12:00:00", 11, 0.0, "2030/12/17 14:59:59");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (102601, "リン", 1.81, 0.0, 4, 24013, 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 24, 10040, "2020/04/30 12:00:00", 12, 0.0, "2030/12/17 14:59:59");
